export const greenhouseGases = {
    'name': 'Greehouse Gases',
    'list': [
        { 'name': 'Carbon Dioxide (CO2)' },
        { 'name': 'Methane (CH4)' },
        { 'name': 'Nitrous Oxide (N2O)' },
        { 'name': 'Fluorinated GHGs', 'child': [
            { 'name': 'HFCs' },
            { 'name': 'PFCs' },
            { 'name': 'SF6' },
            { 'name': 'NF3' },
            { 'name': 'Other Fully Fluorinated GHG' },
            { 'name': 'HFEs' },
            { 'name': 'Very Short Lived Compounds' },
            { 'name': 'Other' }
        ] }
    ]
}
